#include<bits/stdc++.h>
using namespace std;
#define mx 106
int main() {

    ios_base::sync_with_stdio( 0 );
    cin.tie(NULL);
    cout.tie(NULL);
    int t = 1;
    cin >> t;
    while (t--) {
        int n, m;
        cin >> n >> m;
        int x, y;
        int mat[n][mx];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < mx; j++) {
                mat[i][j] = 0;
            }
        }
        for (int i = 0; i < n; i++) {
            string s;
            cin >> s;
            for (int j = 0; j < s.size(); j++) {
                if (s[j] == 's') {
                    x = i, y = j;
                    mat[i][j] = 1;
                }
                else
                if (s[j] != '.') {
                    mat[i][j] = 1;
                }
            }
        }
        queue<vector<int>>q;
        q.push({x, y});

        while (!q.empty()) {
            x = q.front()[0];
            y = q.front()[1];
            q.pop();
            if (y+1 < mx && mat[x][y+1] == 0) {
                if (y+3 < mx && mat[x][y+3] == 0) {
                    q.push({x, y+3});
                    mat[x][y+3] = 2;
                }
                if (x-1>=0&&y+3<mx&&!mat[x-1][y+3]&&!mat[x][y+1] && !mat[x-1][y+1]) {
                    q.push({x-1, y+3});
                    mat[x-1][y+3] = 2;
                }
                if (x+1<n&&y+3<mx&&!mat[x+1][y+3]&&!mat[x][y+1] && !mat[x+1][y+1]) {
                    q.push({x+1, y+3});
                    mat[x+1][y+3] = 2;
                }
            }
        }
        int key = 0;
        for (int i = 0; i < n; i++) {
            for (int j = m-1; j < mx; j++) {
                if (mat[i][j] == 2) {
                    key = 1; break;
                }
            }
        }
        if (key == 1) cout << "yes\n";
        else cout << "no\n";
    }

  return 0;
}
